import React,{component} from 'react';
import { Button} from 'react-bootstrap';
import{BrowserRouter as Router,Switch,Link,Route} from 'react-router-dom'
import './App.css';
import Navbar from './components/Navbar';

function App() {
  return (
    <>
    <Router>
    <Link to="/about">About</Link>
      <Switch>
        <Route path="/about">
              <Navbar />
        </Route>
      </Switch>

    </Router>


    </>


  );
}

export default App;
